import React from 'react';
import Personal from '../Personal';
import Career from '../Career';
import styles from './About.module.scss';
const { container } = styles;

const About = () => (
  <div className={container}>
    <h1>About me</h1>
    <Personal />
    <Career />
  </div>
);

export default About;
